import Team from "./Team";
import { TeamContext } from "./App";
import { useContext } from "react";

function TeamList({ login, user }) {
    const teams = useContext(TeamContext)
    return(
        <div>
            <ul>
                {teams.map((team) => (
                    <Team
                        key={team.id}
                        city={team.city}
                        mascot={team.mascot}
                        wins={team.wins}
                        theme={team.theme}
                        rosters={team.rosters}
                        login={login}
                        user={user}
                    /> 
                ))}
            </ul>
        </div>
    )
}

export default TeamList;
